import React, { Component } from "react";
import { Link } from "react-router-dom";

class Navbar extends Component {
  render() {
    return (
      <nav className="navbar navbar-expand-lg bg-light">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">STYLE-TRANSFER</Link>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/addstyle">Add Style</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/customizedstyle">Customized Style</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/multiplestyles">Multiple Styles</Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    );
  };
};

export default Navbar;
